column1:
Usage: nmcli general status { help }

Show overall status of NetworkManager.
'status' is the default action, which means 'nmcli gen' calls 'nmcli gen status'

column3:
ବ୍ୟବହାର ବିଧି: nmcli general status { help }

NetworkManager ର ସମ୍ପୂର୍ଣ୍ଣ ସ୍ଥିତି ଦର୍ଶାନ୍ତୁ।
'status' ଟି ହେଉଛି ପୂର୍ବନିର୍ଦ୍ଧାରିତ କାର୍ଯ୍ୟ, ଯାହା ଅର୍ଥ ହେଉଛି 'nmcli gen' calls 'nmcli gen status'

column1:
