  connectivity [check]

column3:
ବ୍ୟବହାର ବିଧି: nmcli networking { COMMAND | help }

COMMAND := { [ on | off | connectivity ] }

  on

  off

  connectivity [check]

column1:
Usage: nmcli radio all { ARGUMENTS | help }

ARGUMENTS := [on | off]

Get status of all radio switches, or turn them on/off.

column3:
ବ୍ୟବହାର ବିଧି: nmcli radio all { ARGUMENTS | help }

ARGUMENTS := [on | off]

ସମସ୍ତ ରେଡ଼ିଓ ସ୍ୱୀଚଗୁଡ଼ିକର ସ୍ଥିତି ପ୍ରାପ୍ତ କରନ୍ତୁ, ଅଥବା ସେଗୁଡ଼ିକୁ ଅନ/ଅଫ କରନ୍ତୁ।

column1:
Usage: nmcli radio wifi { ARGUMENTS | help }

ARGUMENTS := [on | off]

Get status of Wi-Fi radio switch, or turn it on/off.

column3:
ବ୍ୟବହାର ବିଧି: nmcli radio wifi { ARGUMENTS | help }

ARGUMENTS := [on | off]

Wi-Fi ରେଡ଼ିଓ ସ୍ୱୀଚର ସ୍ଥିତି ପ୍ରାପ୍ତ କରନ୍ତୁ, ଅଥବା ତାହାକୁ ଅନ/ଅଫ କରନ୍ତୁ।

column1:
Usage: nmcli radio wwan { ARGUMENTS | help }

ARGUMENTS := [on | off]

Get status of mobile broadband radio switch, or turn it on/off.

column3:
ବ୍ୟବହାର ବିଧି: nmcli radio wwan { ARGUMENTS | help }

ARGUMENTS := [on | off]

ମୋବାଇଲ ବ୍ରୋଡବ୍ୟାଣ୍ଡ ରେଡ଼ିଓ ସ୍ୱୀଚର ସ୍ଥିତି ପ୍ରାପ୍ତ କରନ୍ତୁ, ଅଥବା ତାହାକୁ ଅନ/ଅଫ କରନ୍ତୁ।
